import React from "react";
import Stock from "./Stock";

const PassText = ({ someText, setPrediction }) => {
  return (
    <div>
      {someText.symbol && (
        <>
          <h1>{someText.symbol}</h1>
          <Stock sign={someText.symbol} setPrediction={setPrediction} />
        </>
      )}
    </div>
  );
};

export default PassText;
